-- Create a utility proc to load SSIS packages from disk
IF OBJECT_ID('tempdb.dbo.#syscollector_read_xml_from_file', 'P') IS NOT NULL
BEGIN
  DROP PROC #syscollector_read_xml_from_file;
END;
GO
CREATE PROCEDURE #syscollector_read_xml_from_file
    @filename   NVARCHAR(2048), 
    @xmlfile    VARBINARY(MAX) OUTPUT
AS
BEGIN
    SET NOCOUNT ON;
    RAISERROR ('Reading XML file from disk: %s', 0, 1, @filename) WITH NOWAIT;

    CREATE TABLE #bulkpackage
        (
            packagexml xml NOT NULL
        );

    DECLARE @stmt_bulkinsert NVARCHAR(2048);
    SET @stmt_bulkinsert = N'
    BULK INSERT #bulkpackage
    FROM ' 
    -- Escape any embedded single quotes (we can't use QUOTENAME here b/c it can't handle strings > 128 chars)
    + '''' + REPLACE(@filename COLLATE database_default, N'''', N'''''') + '''
    WITH
        (
            DATAFILETYPE = ''char'',
            FIELDTERMINATOR = ''dc:stub:ft'',
            ROWTERMINATOR = ''dc:stub:rt'',
            CODEPAGE = ''RAW''
        );
    ';

    EXECUTE sp_executesql @stmt_bulkinsert;

    DECLARE @bytesLoaded INT;
    SELECT @bytesLoaded = ISNULL (DATALENGTH (packagexml), 0) FROM #bulkpackage
    PRINT 'Loaded ' + CONVERT (VARCHAR, @bytesLoaded)
            + ' bytes from ' 
            + '''' + REPLACE(@filename COLLATE database_default, N'''', N'''''') + '''';

    SELECT @xmlfile = convert(VARBINARY(MAX),packagexml) FROM #bulkpackage;

    DROP TABLE #bulkpackage;
END;
GO

-- Create a utility proc to save SSIS package definitions to msdb
IF OBJECT_ID('tempdb.dbo.#syscollector_save_ssis_package', 'P') IS NOT NULL
BEGIN
  DROP PROC #syscollector_save_ssis_package;
END;
GO
CREATE PROCEDURE #syscollector_save_ssis_package
    @package        VARBINARY(MAX),
    @packagename    SYSNAME,
    @packageid      UNIQUEIDENTIFIER,
    @versionid      UNIQUEIDENTIFIER
AS
BEGIN
    RAISERROR ('Saving SSIS package "%s" to msdb', 0, 1, @packagename) WITH NOWAIT;

    DECLARE @loadtime DATETIME;
    SET @loadtime = GETDATE();

    EXECUTE msdb.dbo.sp_ssis_putpackage
        @name = @packagename, 
        @id = @packageid, 
        @description = N'Custom Data Collector Package', 
        @createdate = @loadtime, 
        @folderid = '8877FE4B-A938-4a51-84B9-C5BDAD74B0AD', 
        @packagedata = @package, 
        @packageformat = 1, 
        @packagetype = 5,  -- DTSPKT_DTSDESIGNER100
        @vermajor = 1, 
        @verminor = 0, 
        @verbuild = 0, 
        @vercomments = N'', 
        @verid = @versionid;
END;
GO

/*
  To simplify installation, this script holds the SSIS package definitions inline as VARBINARY blobs.  
  If you wish to edit the packages and re-load the packages from disk, load the packages from disk by 
  uncommenting the "#syscollector_read_xml_from_file" calls below.
  Use the following query to extract the VARBINARY blobs from the SSIS package store in msdb: 
  
	SELECT name, CAST('<![CDATA[' + char(13) + char(10) + CONVERT(varchar(max), CAST(packagedata AS varbinary(max)), 1) + char(13) + char(10) + ' ]]>' AS xml)
	FROM msdb.dbo.sysssispackages
	WHERE name LIKE 'PoSh%'

*/
DECLARE @package VARBINARY(MAX);
--SET @package = 
-- To read this package in from disk, uncomment the lines below and fix the file path
 EXECUTE #syscollector_read_xml_from_file 
     @filename = 'D:\Progetti\ExtendedTSQLCollector\CollectionSet\ExtendedTSQLUpload.dtsx', 
     @xmlfile = @package OUTPUT;
EXECUTE #syscollector_save_ssis_package
    @package=@package, 
    @packagename='ExtendedTSQLUpload', 
    @packageid='F2577F08-EED4-40EF-A9B9-46C00CFF86AE', 
    @versionid='8A9B1A23-3047-4731-88A5-065408AF75B5';
GO



DECLARE @package VARBINARY(MAX);
--SET @package = 
-- To read this package in from disk, uncomment the lines below and fix the file path
 EXECUTE #syscollector_read_xml_from_file 
     @filename = 'D:\Progetti\ExtendedTSQLCollector\CollectionSet\ExtendedTSQLCollect.dtsx', 
     @xmlfile = @package OUTPUT;
EXECUTE #syscollector_save_ssis_package 
    @package=@package, 
    @packagename='ExtendedTSQLCollect', 
    @packageid='B015DBE6-0B9E-4D12-AF52-9386943332E7', 
    @versionid='6C116DC0-5C2A-43CC-B69F-E36AB8D1250B';
GO











-- Now that the collector type's packages have been uploaded, (re)define the collector type
-- If the collection set exists, we have to drop that, first. 
IF EXISTS (SELECT * FROM syscollector_collection_sets WHERE name = 'Single Use Cached Plans')
BEGIN
    RAISERROR ('Dropping collection set "Single Use Cached Plans"...',0, 1) WITH NOWAIT;
    EXEC sp_syscollector_delete_collection_set @name = 'Single Use Cached Plans';
END;
GO
IF EXISTS (SELECT * FROM msdb.dbo.syscollector_collector_types WHERE name = 'Extended T-SQL Query Collector Type')
BEGIN
    RAISERROR ('Dropping collector type "Extended T-SQL Query Collector Type"...',0, 1) WITH NOWAIT;
    EXEC msdb.dbo.sp_syscollector_delete_collector_type 
        @collector_type_uid = 'FD34D746-9A4D-4901-B872-3AF7CDBF7D37', 
        @name = 'Extended T-SQL Query Collector Type';
END;
GO
RAISERROR ('Creating collector type "Extended T-SQL Query Collector Type"...',0, 1) WITH NOWAIT;

DECLARE @parameter_schema xml, 
	@parameter_formatter xml

SELECT  @parameter_schema = parameter_schema, 
	@parameter_formatter = parameter_formatter
FROM syscollector_collector_types 
WHERE name = 'Generic T-SQL Query Collector Type'

EXEC sp_syscollector_create_collector_type 
    @collector_type_uid = 'FD34D746-9A4D-4901-B872-3AF7CDBF7D37', 
    @name = 'Extended T-SQL Query Collector Type', 
    @parameter_schema = @parameter_schema, 
    @parameter_formatter = @parameter_formatter, 
    @collection_package_id = 'B015DBE6-0B9E-4D12-AF52-9386943332E7', 
    @upload_package_id = 'F2577F08-EED4-40EF-A9B9-46C00CFF86AE';
GO




-----------------------------------------------------------------------------
/*
    ======
    Create Collection Set
    ======
*/
-- Create the collection set
RAISERROR ('Creating collection set "Single-use Cached Plans"...',0, 1) WITH NOWAIT;
DECLARE @schedule_uid UNIQUEIDENTIFIER;
SELECT @schedule_uid = (select schedule_uid from sysschedules_localserver_view where name=N'CollectorSchedule_Every_6h');
DECLARE @collection_set_id INT;
EXEC dbo.sp_syscollector_create_collection_set 
    @name = N'Single Use Cached Plans', 
    @schedule_uid = @schedule_uid,  -- 6 hours
    @collection_mode = 0,           -- noncached
    @days_until_expiration = 30,    -- retain stats for 30 days
    @description = N'Collects Single Use Cached Plans', 
    @collection_set_id = @collection_set_id output, 
    @collection_set_uid = '989413FA-FB42-4B99-A8D1-40C658C8DA6C';



-- Create a collection item to capture cached plans
DECLARE @parameters xml;
DECLARE @collection_item_id INT;
SELECT @parameters = convert(xml, N'
<ns:TSQLQueryCollector xmlns:ns="DataCollectorType">
    <Query>
        <Value>
            SELECT TOP(50) T.[text] AS [QueryText], cp.size_in_bytes, CAST(P.query_plan AS nvarchar(max)) AS query_plan
            FROM sys.dm_exec_cached_plans AS cp WITH (NOLOCK)
            CROSS APPLY sys.dm_exec_sql_text(plan_handle) AS T
            CROSS APPLY sys.dm_exec_query_plan(plan_handle) AS P
            WHERE cp.cacheobjtype = N''Compiled Plan'' 
            AND cp.objtype = N''Adhoc'' 
            AND cp.usecounts = 1
            ORDER BY cp.size_in_bytes DESC OPTION (RECOMPILE);
        </Value>
        <OutputTable>cached_plans</OutputTable>
    </Query>
</ns:TSQLQueryCollector>
');

RAISERROR ('Creating collection item "Single Use Cached Plans"...',0, 1) WITH NOWAIT;
EXEC dbo.sp_syscollector_create_collection_item
    @collection_set_id = @collection_set_id,
    @collector_type_uid = N'FD34D746-9A4D-4901-B872-3AF7CDBF7D37', -- Extended T-SQL Collector Type
    @name = 'Single Use Cached Plans Collection Item',
    @frequency = 60, 
    @parameters = @parameters,
    @collection_item_id = @collection_item_id OUTPUT;

GO 

USE MDW;
------------------------------------------------
-- EXECUTE IN THE MDW
------------------------------------------------
IF NOT EXISTS (SELECT * FROM sys.extended_properties WHERE name = 'Microsoft_DataCollector_MDW_Version')
BEGIN
    RAISERROR ('ERROR: This script must be executed within a Management Data Warehouse database.  Please change the database context to your MDW database before running the script.', 21, 1) WITH NOWAIT, LOG;
END
ELSE
BEGIN
	EXEC core.sp_add_collector_type @collector_type_uid = 'FD34D746-9A4D-4901-B872-3AF7CDBF7D37'
END


